import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
import SideBar from './Components/SideBar';
import Dashboard from './Components/Dashboard';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Header/>
      <SideBar/>
      <Dashboard/>
      <Footer/>

    </div>
  );
}

export default App;
